import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, NavLink } from "react-router-dom";
import { motion } from "framer-motion";
import { FaBars, FaTimes, FaLinkedin, FaGithub, FaInstagram } from "react-icons/fa";
import Portfolio from "./Portfolio";
import About from "./About";
import Services from "./Services";
import Works from "./Works";
import Blog from "./Blog";
import Contact from "./Contact";

export default function App() {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [isDark, setIsDark] = useState(true);
  const [cursorPosition, setCursorPosition] = useState({ x: 0, y: 0 });

  const handleMouseMove = (e) => setCursorPosition({ x: e.clientX, y: e.clientY });

  return (
    <Router>
      <div
        onMouseMove={handleMouseMove}
        className={`flex min-h-screen ${isDark ? "bg-gray-900 text-white" : "bg-gray-50 text-gray-900"} relative overflow-hidden`}
      >
        {/* Animated Background */}
        <motion.div
          className="absolute inset-0 bg-gradient-to-br from-indigo-500 to-purple-600 opacity-20"
          animate={{ scale: [1, 1.1, 1] }}
          transition={{ duration: 10, repeat: Infinity }}
        />

        {/* Custom Cursor */}
        <motion.div
          className="fixed w-4 h-4 bg-indigo-500 rounded-full pointer-events-none"
          animate={{ x: cursorPosition.x - 8, y: cursorPosition.y - 8 }}
          transition={{ type: "spring", stiffness: 500, damping: 28 }}
        />

        {/* Sidebar */}
        <motion.aside
          initial={{ x: "-100%", rotateY: 90 }}
          animate={{ x: sidebarOpen ? 0 : "-100%", rotateY: sidebarOpen ? 0 : 90 }}
          transition={{ duration: 0.5 }}
          className="fixed top-0 left-0 h-full bg-gray-900 text-white w-64 p-6 flex flex-col justify-between shadow-lg md:translate-x-0"
        >
          <div>
            <h1 className="text-2xl font-semibold">Chiranjeevi</h1>
            <nav className="mt-10 space-y-4">
              {navigationItems.map((item) => (
                <NavLink
                  key={item.name}
                  to={item.path}
                  className={({ isActive }) =>
                    `relative block text-gray-400 hover:text-white ${isActive ? "text-white font-medium" : ""}`
                  }
                  onClick={() => setSidebarOpen(false)}
                >
                  {item.name}
                  <motion.span
                    className="absolute bottom-0 left-0 w-full h-0.5 bg-white"
                    initial={{ scaleX: 0 }}
                    whileHover={{ scaleX: 1 }}
                    transition={{ duration: 0.3 }}
                  />
                </NavLink>
              ))}
            </nav>
          </div>
          <div className="space-y-6">
            <div className="flex gap-6">
              {socialLinks.map((link, index) => (
                <motion.a
                  key={index}
                  href={link.href}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-gray-400"
                  whileHover={{ scale: 1.2, rotate: 360 }}
                  transition={{ duration: 0.4 }}
                >
                  {link.icon}
                </motion.a>
              ))}
            </div>
            <p className="text-gray-500 text-xs">¬© {new Date().getFullYear()} Chiranjeevi Kumar.</p>
          </div>
        </motion.aside>

        {/* Mobile Toggle */}
        <button
          className="absolute top-4 left-4 text-gray-900 md:hidden"
          onClick={() => setSidebarOpen(!sidebarOpen)}
        >
          {sidebarOpen ? <FaTimes size={28} /> : <FaBars size={28} />}
        </button>

        {/* Theme Toggle */}
        <motion.button
          className="absolute top-4 right-4"
          onClick={() => setIsDark(!isDark)}
          animate={{ rotate: isDark ? 180 : 0 }}
        >
          {isDark ? "‚òÄÔ∏è" : "üåô"}
        </motion.button>

        {/* Main Content */}
        <motion.main
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          className="flex-1 p-6 md:p-12 lg:p-16 ml-0 md:ml-64"
        >
          <Routes>
            <Route path="/" element={<Portfolio />} />
            <Route path="/about" element={<About />} />
            <Route path="/services" element={<Services />} />
            <Route path="/works" element={<Works />} />
            <Route path="/blog" element={<Blog />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
        </motion.main>
      </div>
    </Router>
  );
}
